import React, {useState, useEffect} from 'react';
import './App.css';

const List = () => {
  const [todos, setTodos] = useState([]);
  const fetchTodos = async () => {
    const res = await fetch('http://localhost:3001/todos');
    console.log(res.json);
  }
  useEffect(() => {
    setTodos(fetchTodos());
  }, []);
  return (<div>{todos}</div>)
}

function App() {

  return (
    <div className="App">
      <h1> Todos </h1>
      <List/>
    </div>
  );
}

export default App;
